"use client"

import { useState, useEffect } from "react"
import "./StockGraph.css"

const StockGraph = ({ stock, data, currentPrice }) => {
  const [maxPrice, setMaxPrice] = useState(currentPrice)
  const [minPrice, setMinPrice] = useState(currentPrice)

  useEffect(() => {
    if (data && data.length > 0) {
      const prices = data.map((d) => d.price)
      setMaxPrice(Math.max(...prices))
      setMinPrice(Math.min(...prices))
    }
  }, [data])

  if (!data || data.length === 0) {
    return <div className="graph-loading">Loading chart...</div>
  }

  const range = maxPrice - minPrice || 1
  const points = data.map((d, i) => {
    const x = (i / (data.length - 1 || 1)) * 100
    const y = ((maxPrice - d.price) / range) * 100
    return { x, y, price: d.price, time: d.time }
  })

  const pathData = points.map((p, i) => `${i === 0 ? "M" : "L"} ${p.x} ${p.y}`).join(" ")

  const isPriceUp = data.length > 1 && data[data.length - 1].price >= data[0].price
  const priceChange = data.length > 1 ? data[data.length - 1].price - data[0].price : 0
  const percentChange = data.length > 1 ? ((priceChange / data[0].price) * 100).toFixed(2) : 0

  return (
    <div className="stock-graph-container">
      <div className="graph-header">
        <div className="graph-info">
          <span className="graph-stock">{stock}</span>
          <span className={`graph-price ${isPriceUp ? "up" : "down"}`}>${currentPrice.toFixed(2)}</span>
        </div>
        <div className={`graph-change ${isPriceUp ? "positive" : "negative"}`}>
          {isPriceUp ? "↑" : "↓"} {Math.abs(priceChange).toFixed(2)} ({percentChange}%)
        </div>
      </div>

      <div className="graph-canvas">
        <svg viewBox="0 0 100 100" preserveAspectRatio="none" className="graph-svg">
          {/* Grid lines */}
          <line x1="0" y1="25" x2="100" y2="25" className="grid-line" />
          <line x1="0" y1="50" x2="100" y2="50" className="grid-line" />
          <line x1="0" y1="75" x2="100" y2="75" className="grid-line" />

          {/* Price line */}
          <path d={pathData} className={`price-line ${isPriceUp ? "up" : "down"}`} />

          {/* Filled area under line */}
          <path d={`${pathData} L 100 100 L 0 100 Z`} className={`price-area ${isPriceUp ? "up" : "down"}`} />

          {/* Current price point */}
          {points.length > 0 && (
            <circle cx={points[points.length - 1].x} cy={points[points.length - 1].y} r="1.5" className="price-point" />
          )}
        </svg>
      </div>

      <div className="graph-stats">
        <div className="stat">
          <span className="stat-label">High</span>
          <span className="stat-value">${maxPrice.toFixed(2)}</span>
        </div>
        <div className="stat">
          <span className="stat-label">Low</span>
          <span className="stat-value">${minPrice.toFixed(2)}</span>
        </div>
        <div className="stat">
          <span className="stat-label">Data Points</span>
          <span className="stat-value">{data.length}</span>
        </div>
      </div>
    </div>
  )
}

export default StockGraph
